  [],\n\t\"revision_timestamp\": \"2015-09-27T00:59:40.590144\",\n\t\"name\": \"argo-float-data-from-the-apdrc-dapper-server\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The floats are designed to drift at a fixed
  pressure (usually 1000 dbar) for 10 days. After this period, the floats move to
  a profiling pressure (usually between 1000 and 2000 dbar) then rise, collecting
  profiles of pressure, temperature, and salinity data on their way to the surface.
  Once at the surface, the floats remain there for under a day, transmitting the data
  collected by satellite back to NOAA/PMEL and allowing the satellite to determine
  their surface drift. They then sink again and repeat their mission. The floats have
  a nominal lifetime of five years, and will yield valuable information about large-scale
  ocean water property distributions and currents, including their variability over
  time scales from seasonal to the duration of the array.nnNote that a given request
  will return a maximum of 15000 rows of data.  So if you get a response with ~15000
  rows, resubmit the request as 2 or more smaller requests.\",\n\t\"license_title\":
